import React from 'react';
import './App.css';
import {Route, Routes} from "react-router-dom";
import {Dialogs} from "./components/profileContentComponents/Dialogs/Dialogs";
import {ProfileContent} from "./components/profileContentComponents/Profile/ProfileContent";
import {NavBar} from "./components/Navbar/NavBar";
import {Header} from "./components/Header/Header";




function App(props) {


    return (
            <div className="app-wrapper">
                <Header/>
                <NavBar/>
                <div className="app-wrapper-content">
                    <Routes>
                        <Route path={'PROFILE'}
                               element={<ProfileContent state={props.state.profilePage} addPost={props.state.addPost}/>}/>



                        <Route path={'DIALOGS/:DIALOG?'}
                               element={<Dialogs state={props.state.dialogsPage} />}/>/


                        {/*<Route path={'NEWS'} element={<News/>}/>*/}
                        {/*<Route path={'MUSIC'} element={<Music/>}/>*/}
                        {/*<Route path={'SETTINGS'} element={<Settings/>}/>*/}
                    </Routes>
                </div>
            </div>
    );

}


export default App;
